import React from "react";

const App = () => {
    return (
        <div className="App font-body">
            <div>
                <div>
                    <img src="./images/image-daniel.jpg" ></img>
                    <div>
                        <span>Daniel Clifford</span>
                        <span> Verified Graduate</span>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default App;
